import "./Footer.scss";
import github from "../../assets/images/github-icon.svg";
import linkedin from "../../assets/images/linkedin-black.svg";
import instagram from "../../assets/images/instagram-black.svg";
import twitter from "../../assets/images/twitter-black.svg";
import { Link } from "react-router-dom";

function Footer() {
  return (
    <>
      <section className="footer">
        <h2 className="footer__title">Contact Us</h2>

        <div className="footer__social">
          <img
            className="footer__handle"
            src={instagram}
            alt="instagram icon"
          />
          <img className="footer__handle" src={linkedin} alt="linkedin icon" />
          <img className="footer__handle" src={github} alt="github icon" />
          <img className="footer__handle" src={twitter} alt="twitter icon" />
        </div>

        <div className="footer__acknowledgements">
          <Link className="footer__email" href="mailto:info@sproutrinc.com">
            info@sproutrInc.com
          </Link>

          <span className="footer__brand">Sproutr</span>
          <span className="footer__copyright">Â© 2022 All Rights Reserved</span>
        </div>
      </section>
    </>
  );
}

export default Footer;
